import React, { useState, useEffect } from 'react';
import { userAPI } from '../utils/api';

const AdminUsers = () => {
  const [users, setUsers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const response = await userAPI.getAll();
      setUsers(response.data);
    } catch (error) {
      console.error('Error fetching users:', error);
      setError('Failed to fetch users');
    } finally {
      setLoading(false);
    }
  };

  const toggleUserStatus = async (userId, currentStatus) => {
    try {
      await userAPI.updateStatus(userId, !currentStatus);
      setUsers(users.map(user => 
        user._id === userId ? { ...user, isActive: !currentStatus } : user
      ));
      setMessage('User status updated successfully');
      setTimeout(() => setMessage(''), 3000);
    } catch (error) {
      console.error('Error updating user status:', error);
      setError('Failed to update user status');
    }
  };

  const deleteUser = async (userId) => {
    if (window.confirm('Are you sure you want to delete this user?')) {
      try {
        await userAPI.delete(userId);
        setUsers(users.filter(user => user._id !== userId));
        setMessage('User deleted successfully');
        setTimeout(() => setMessage(''), 3000);
      } catch (error) {
        console.error('Error deleting user:', error);
        setError('Failed to delete user');
      }
    }
  };

  if (loading) {
    return <div style={styles.loading}>Loading users...</div>;
  }

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Manage Users</h1>

      {message && <div style={styles.successMessage}>{message}</div>}
      {error && <div style={styles.errorMessage}>{error}</div>}

      <div style={styles.tableContainer}>
        <table style={styles.table}>
          <thead>
            <tr style={styles.headerRow}>
              <th style={styles.th}>Name</th>
              <th style={styles.th}>Email</th>
              <th style={styles.th}>Role</th>
              <th style={styles.th}>Status</th>
              <th style={styles.th}>Joined</th>
              <th style={styles.th}>Actions</th>
            </tr>
          </thead>
          <tbody>
            {users.length === 0 ? (
              <tr>
                <td colSpan="6" style={styles.noData}>No users found</td>
              </tr>
            ) : (
              users.map(user => (
                <tr key={user._id} style={styles.row}>
                  <td style={styles.td}>{user.name}</td>
                  <td style={styles.td}>{user.email}</td>
                  <td style={styles.td}>
                    <span style={{...styles.role, backgroundColor: user.isAdmin ? '#ff6b35' : '#28a745'}}>
                      {user.isAdmin ? 'Admin' : 'User'}
                    </span>
                  </td>
                  <td style={styles.td}>
                    <span style={{...styles.status, backgroundColor: user.isActive ? '#28a745' : '#dc3545'}}>
                      {user.isActive ? 'Active' : 'Inactive'}
                    </span>
                  </td>
                  <td style={styles.td}>
                    {new Date(user.createdAt).toLocaleDateString()}
                  </td>
                  <td style={styles.td}>
                    <button 
                      onClick={() => toggleUserStatus(user._id, user.isActive)}
                      style={{...styles.actionBtn, backgroundColor: user.isActive ? '#dc3545' : '#28a745'}}
                    >
                      {user.isActive ? 'Deactivate' : 'Activate'}
                    </button>
                    {!user.isAdmin && (
                      <button 
                        onClick={() => deleteUser(user._id)}
                        style={{...styles.actionBtn, backgroundColor: '#dc3545', marginLeft: '0.5rem'}}
                      >
                        Delete
                      </button>
                    )}
                  </td>
                </tr>
              ))
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

const styles = {
  container: {
    padding: '2rem',
    backgroundColor: '#fef7f0',
    minHeight: '90vh'
  },
  title: {
    fontSize: '2rem',
    fontWeight: '700',
    color: '#333',
    marginBottom: '2rem'
  },
  tableContainer: {
    backgroundColor: 'white',
    borderRadius: '15px',
    boxShadow: '0 4px 15px rgba(0,0,0,0.1)',
    overflow: 'hidden'
  },
  table: {
    width: '100%',
    borderCollapse: 'collapse'
  },
  headerRow: {
    backgroundColor: '#f8f9fa'
  },
  th: {
    padding: '1rem',
    textAlign: 'left',
    fontWeight: '600',
    color: '#333',
    borderBottom: '2px solid #e9ecef'
  },
  row: {
    borderBottom: '1px solid #e9ecef'
  },
  td: {
    padding: '1rem',
    color: '#666'
  },
  role: {
    padding: '0.25rem 0.75rem',
    borderRadius: '15px',
    color: 'white',
    fontSize: '0.8rem',
    fontWeight: '600'
  },
  status: {
    padding: '0.25rem 0.75rem',
    borderRadius: '15px',
    color: 'white',
    fontSize: '0.8rem',
    fontWeight: '600'
  },
  actionBtn: {
    padding: '0.5rem 1rem',
    border: 'none',
    borderRadius: '20px',
    color: 'white',
    fontSize: '0.8rem',
    fontWeight: '600',
    cursor: 'pointer'
  },
  loading: {
    textAlign: 'center',
    padding: '4rem',
    fontSize: '1.2rem',
    color: '#666'
  },
  noData: {
    textAlign: 'center',
    padding: '2rem',
    color: '#666'
  },
  successMessage: {
    backgroundColor: '#d4edda',
    color: '#155724',
    padding: '1rem',
    borderRadius: '8px',
    marginBottom: '1rem',
    border: '1px solid #c3e6cb'
  },
  errorMessage: {
    backgroundColor: '#f8d7da',
    color: '#721c24',
    padding: '1rem',
    borderRadius: '8px',
    marginBottom: '1rem',
    border: '1px solid #f5c6cb'
  }
};

export default AdminUsers;
